import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'GymAngular';
}


<nav class="navbar navbar-light bg-light">
  <form class="form-inline">
    <button class="btn btn-outline-success" type="button"  [routerLink]="['CreateWorkout']">Dodaj Trening</button>
    <button class="btn btn-sm btn-outline-secondary" type="button" [routerLink]="['workout']">Lista treningów</button>
  </form>
</nav>

<div class='container'>
  <router-outlet></router-outlet>
</div>
